import React from 'react';
import {Registration,ChatApp,Landing,Login} from "components/modules"
import {Container} from "components/common"
import {Grid,Flex ,Wrapper} from "./styles"
export const HomePage = ()=> {
  return (
    <Wrapper  >
        <Grid as={Container}>
          <Landing/>
          <Flex >
            <Login />
            <Registration />
          </Flex>
        </Grid>
        {/* <ChatApp />  */}

    </Wrapper>
  );
}

